VELOCITY = 85 -- constant

local Pellet = Instance.new("Part")
Pellet.Name = "Roll"
Pellet.Locked = true
Pellet.BackSurface = 0
Pellet.BottomSurface = 0
Pellet.FrontSurface = 0
Pellet.LeftSurface = 0
